    pub const fn item_const_eval(ctx: &Ctx, item_id: ItemId, attack_type: AttackType) -> [f32; 2] {
        match item_id {
            ItemId::BladeOfTheRuinedKing => match attack_type {
                AttackType::Melee => [blade_of_the_ruined_king_melee_min(ctx), zero(ctx)],
                AttackType::Ranged => [blade_of_the_ruined_king_ranged_min(ctx), zero(ctx)],
            },
            ItemId::BladeOfTheRuinedKingArena => match attack_type {
                AttackType::Melee => [blade_of_the_ruined_king_arena_melee_min(ctx), zero(ctx)],
                AttackType::Ranged => [blade_of_the_ruined_king_arena_ranged_min(ctx), zero(ctx)],
            },
            ItemId::NashorsTooth => [nashors_tooth_min(ctx), zero(ctx)],
            ItemId::NashorsToothArena => [nashors_tooth_arena_min(ctx), zero(ctx)],
            _ => [0.0, 0.0],
        }
    }
